import React from 'react';

class SignUpForm extends React.Component{
    constructor(){
        super()
        this.state= {
            resp: {
                firstName: '',
                lastName: '',
                phoneNumber: '',
                email: '',
                password: '',
                role: '',
                username:''
            },
            confirmPassword: ''
        }
    }

    render(){
        return(
            <div>
                <form>
                <label name='firstName'> First Name: </label>
                <input type='text' value={this.state.firstName}></input>

                <label name='lastName'> Last Name: </label>
                <input type='text' value={this.state.lastName}></input>

                <label name='email'> Email: </label>
                <input type='text' value={this.state.email}></input>

                <label name='phoneNumber'> Phone Number: </label>
                <input type='text' value={this.state.phoneNumber}></input>

                <label name='role'> Role: </label>
                <select value={this.state.role}>
                    <option value=''>Please choose an option</option>
                    <option value="PROJECT_OWNER">Project Owner</option>
                    <option value="TRADE_PARTNER">Trade Partner</option>
                    <option value="TASK_OWNER">Task Owner</option>
                </select>

                <label name='username'> Username: </label>
                <input type='text' value={this.state.username}></input>
                </form>
            </div>

        )
    }
}

export default SignUpForm;
